import React from "react";

export function Cards({children}) {
    return (
        <div class="card" style={{width: "18rem", marginLeft: '100px', marginTop: "100px", border: "solid green"}}>
            {children}
        </div>
        )
}

export function Images({image, imageText}) {
        return (
            <img src={image} class="card-img-top" alt={imageText} /> 
        )
}

export function Title({title, text}) {
    return (
       <div  style={{color: '#666666', padding: "15px"}}>
        <h3>{title}</h3>
        <p>{text}</p>
        <button style={{background: "#1e90ff", padding: "13px", color: "#ffffff", border: "none", fontWeight: "600"}}>Go somewhere</button>
       </div>
    )
}
